  // read the text from the user
  String text = Serial.readString();

  // convert the text to Morse code
  for (int i = 0; i < text.length(); i++) {
    char c = text.charAt(i);
    int index = c - 'a';
    if (index >= 0 && index < 26) {
      // the character is a lowercase letter
      String morseCodeString = morseCode[index];
      for (int j = 0; j < morseCodeString.length(); j++) {
        char element = morseCodeString.charAt(j);
        if (element == '.') {
          // this is a dot
          tone(9, 1000, dotDuration);
          delay(spaceDuration);
        } else if (element == '-') {
          // this is a dash
          tone(9, 1000, dashDuration);
          delay(spaceDuration);
        }
      }
      delay(letterSpaceDuration);
    } else if (c == ' ') {
      // the character is a space
      delay(wordSpaceDuration);
    }
  }
}

void tone(int pin, int frequency, int duration) {
  // play a tone on the specified pin for the specified duration
  digitalWrite(pin, HIGH);
  delay(duration);
  digitalWrite(pin, LOW);
}
